function note(name) {
    let thisNote = playTune(tune`
1000: ${name}^1000,
31000`)
    setTimeout(thisNote.end, 500)
}

function splitByLength(str, length) {
  const result = [];
  for (let i = 0; i < str.length; i += length) {
    result.push(str.slice(i, i + length));
  }
  return result;
}

function rle_decode(encoded) {
    let decoded = '';

    encoded = encoded.split(".")
    for (let i = 0; i < encoded.length; i++) {
      const cur = encoded[i]
      const count = parseInt(cur.slice(0,-1), 10);
      const value = cur.slice(-1)
      decoded += value.repeat(count);
    }

  return decoded;
}

function mainLoop(song, video) {
  video = video.split(",")
  const spf = 1000 / Number(video[0])
  const width = Number(video[1])
  const height = Number(video[2])
  video = rle_decode(video[3])
  
  const channels = song.trim().split("\n");
  const frames = splitByLength(video, width * height)

  function playChannel(channelLine) {
    const [channel, notesString] = channelLine.split(":");
    const notes = notesString.trim().split(",");
  
    let currentDelay = 0;
  
    notes.forEach((noteData) => {
      const [noteName, timeSinceLast] = noteData.split("/");
      const delay = parseInt(timeSinceLast, 10);
      currentDelay += delay;
  
      setTimeout(() => {
        note(noteName);
      }, currentDelay);
    });
  }
  
  function playSong() {
    channels.forEach((channelLine) => {
      playChannel(channelLine);
    });
  }
  
  async function playFrames() {
    for (const frame of frames) {
      let d = splitByLength(frame, width).join("\n")
      setMap(map`${d}`)
      await new Promise(resolve => setTimeout(resolve, spf));
    }
  }
  
  // Start playback
  clearText();
  playSong();
  playFrames();
}


